Shout out to the FABULOUS @baking_by_mahi for making me the most gorgeous and detailed cake! This chocolate cake had the lightest & fluffiest icing! 

@baking_by_mahi is based out of McKinney, so to all my DFW friends: CHECK OUT HER PAGE!!! She makes a variety of delicious baked goods!!! 

Thank you @baking_by_mahi for such a special and FANTASTIC cake!

Who else LOVES bread pudding? 

@the_stix_icehouse has some of my favorite bread pudding of all time. And that big scoop of vanilla ice cream on top is the cherry on top 😍 and check out that caramel drizzle!! 

What is your favorite dessert?

The prettiest pastry I’ve ever laid my eyes on 😍😍😍 check out this Apple Scroll made by @therosemarybakery 🥐 

@therosemarybakery is located at the @mckinneyfarmersmarket every Saturday! If you haven’t stopped by yet, you HAVE TO!!!! 

I’m already craving another one of these apple scrolls!!!

Where do I start first?!?! Queso, guac or salsa?? @the_stix_icehouse has some of my favorite appetizers! 

I looooove their “Get Dippy” appetizer which consists of warm homemade salsa, fresh guac and white queso with candied serranos 😍😍

@the_stix_icehouse is also celebrating their 2nd birthday today and have vendors out in their 14 acres, they’ve got a dunk tank, and activities for the kiddos! Go check them out!

The best comfort food for this chilly weather 🥶 

@doughbrosdallas in Plano, TX makes some DELICIOUS spaghetti and meatballs! Full of flavor and so yummy🤩🤩 and look how big the meatballs are!! 

What are you doing on this chilly Sunday?!?! Hopefully everyone is staying warm!
